      "\u2014 \u0423\u0440\u043E\u043A \u043C\u0430\u043C\u043C\u043E\u043B\u043E\u0433\u0430. \u041C\u043E\u043B\u043E\u0447\u043D\u0430\u044F \u0436\u0435\u043B\u0435\u0437\u0430 \u0438 \u0431\u0435\u0440\u0435\u043C\u0435\u043D\u043D\u043E\u0441\u0442\u044C + pdf-\u0444\u0430\u0439\u043B \u0441 \u043A\u043E\u043D\u0441\u043F\u0435\u043A\u0442\u043E\u043C",
